export function getFullYear() {
    date = new Date().getFullYear();
    return (date);
}



export function getFooterCopy(isIndex) {
    let result ='';
    if (isIndex === true){
        result='Holberton School';
    }
    else{
        result='Holberton School main dashboard';
    }
    return (result);
}
